import { Icon } from 'react-native-elements';

export default function Header({level}) {

    return (
        <div className='header'>
            <div><Icon
          name='sc-telegram'
          type='evilicon'
          color='#517fa4'
        /></div>
            <div>{level ? level: ''}</div>
            <div>settings</div>
        </div>
    );
}
